style.css:
@-moz-document url("https://www.google.com/?igu=1") {
/* Set background GIF */
   body {
       background: url('https://i.imgur.com/2IinHiK.gif') no-repeat center center fixed !important;
       background-size: cover !important;
   }

   /* Hide original Google logo elements */
   #hplogo img, #hplogo svg, #hplogo div {
       display: none !important;
   }

   /* Insert custom logo using background-image */
   #hplogo {
       background-image: url("https://i.imgur.com/WsF7YIC.png") !important;
       background-repeat: no-repeat !important;
       background-position: center !important;
       background-size: contain !important;
       width: 600px !important;  /* Adjust to desired size */
       height: 200px !important; /* Adjust height if necessary */
       margin: 0 auto !important;
   }

   /* Hide footer, white bar, and other elements */
   #fbar, footer, #lb, .ctr-p, .uU7dJb, .c93Gbe {
       display: none !important;
   }
}
